import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-medical-faq',
  templateUrl: './medical-faq.page.html',
  styleUrls: ['./medical-faq.page.scss'],
})
export class MedicalFAQPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>medicalFAQ</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">medicalFAQ</ion-title>
    </ion-toolbar>
  </ion-header>
</ion-content>
